# 916. 单词子集
# https://leetcode-cn.com/problems/word-subsets/

class Solution(object):
    def wordSubsets(self, A, B):
        """
        :type A: List[str]
        :type B: List[str]
        :rtype: List[str]
        """
        result = []

        query = {}
        for b in B:
            tmp = {}
            for c in b:
                if c in tmp:
                    tmp[c] += 1
                else:
                    tmp[c] = 1
            for c in tmp:
                if c in query:
                    query[c] = max(query[c], tmp[c])
                else:
                    query[c] = tmp[c]

        for a in A:
            tmp = {}
            for c in a:
                if c in tmp:
                    tmp[c] += 1
                else:
                    tmp[c] = 1
            failed = False
            for c in query:
                if c not in tmp or tmp[c] < query[c]:
                    failed = True
                    break
            if not failed:
                result.append(a)
        return result

